INSERT INTO `letta`.`events` (`id`, `name`, `description`, `location`, `day`, `tag`, `capacity`, `important`, `image`, `organizer`) VALUES
(6, 'Leer Harry Potter', 'Harry Potter es una serie de novelas fantásticas escrita por la autora británica J. K. Rowling, en la que se describen las aventuras del joven aprendiz de magia y hechicería Harry Potter y sus amigos Hermione Granger y Ron Weasley, durante los años que pasan en el Colegio Hogwarts de Magia y Hechicería. El argumento se centra en la lucha entre Harry Potter y el malvado mago lord Voldemort, quien asesinó a los padres de Harry en su afán de conquistar el mundo mágico.', 'Ourense', '2021-06-24 20:00:00', 'lectura', 10, 0, ,1);
INSERT INTO `letta`.`events` (`id`, `name`, `description`, `location`, `day`, `tag`, `capacity`, `important`, `image`, `organizer`) VALUES
(7, 'Ver partidos Real Madrid', 'El Real Madrid Club de Fútbol, más conocido simplemente como Real Madrid, es una entidad polideportiva con sede en Madrid, España. Fue declarada oficialmente registrada como club de fútbol por sus socios el 6 de marzo de 1902 con el objeto de la práctica y desarrollo de este deporte —si bien sus orígenes datan al año 1900,8​ y su denominación de (Sociedad) Madrid Foot-ball Club a noviembre de 1901— siendo el quinto club fundado en la capital.n. 3​ Tuvo a Julián Palacios y los hermanos Juan Padrós y Carlos Padrós como principales valedores de su creación.9​', 'Madrid', '2021-06-24 20:00:00', 'deportes', 10, 0, ,1);
INSERT INTO `letta`.`events` (`id`, `name`, `description`, `location`, `day`, `tag`, `capacity`, `important`, `image`, `organizer`) VALUES
(8, 'Ver partidos Atlético de Madrid', 'El Club Atlético de Madrid, es un club de fútbol español de la ciudad de Madrid, fundado el 26 de abril de 1903, siendo por ello uno de los clubes de fútbol activos más longevos de España. Desde la temporada 2017-18 disputa sus partidos como local en el estadio Wanda Metropolitano, con capacidad para 68 456 espectadores.', 'Madrid', '2021-06-24 20:00:00', 'deportes', 10, 0, ,1);
