INSERT INTO `letta`.`events` (`id`, `name`, `description`, `location`, `day`, `tag`, `capacity`, `important`, `image`, `organizer`) VALUES
(19, 'Leer El silencio de los corderos', 'The Silence of the Lambs (traducida como El silencio de los corderos en España y El silencio de los inocentes en Hispanoamérica) es una novela de misterio y terror escrita por Thomas Harris en 1988. En 1995, la Mystery Writers of America la incluyó en su lista de las cien mejores novelas de misterio de todos los tiempos.1​ La novela fue adaptada al cine con el mismo título en 1991, logrando 7 candidaturas a los premios Óscar, de las que obtuvo los cinco galardones principales', 'Vigo', '2021-06-24 20:00:00', 'lectura', 10, 0, ,1);
INSERT INTO `letta`.`events` (`id`, `name`, `description`, `location`, `day`, `tag`, `capacity`, `important`, `image`, `organizer`) VALUES
(20, 'Leer El quijote', 'Don Quijote de la Manchaa​ es una novela escrita por el español Miguel de Cervantes Saavedra. Publicada su primera parte con el título de El ingenioso hidalgo don Quijote de la Mancha a comienzos de 1605, es la obra más destacada de la literatura española y una de las principales de la literatura universal, además de ser la más leída después de la Biblia.1​2​ En 1615 apareció su continuación con el título de Segunda parte del ingenioso caballero don Quijote de la Mancha. El Quijote de 1605 se publicó dividido en cuatro partes; pero al aparecer el Quijote de 1615 en calidad de Segunda parte de la obra, quedó revocada de hecho la partición en cuatro secciones del volumen publicado diez años antes por Cervantes.3​', 'A Coruña', '2021-06-24 20:00:00', 'lectura', 10, 0, ,1);
